// n8n Code node (JavaScript)
// --- Helpers (strip any IDs, keep only name & status) ---
const norm = (v) => (typeof v === "string" ? v.trim() : (v ?? ""));
const statusOf = (s) => String(s ?? "").trim().toLowerCase();

// New function to normalize person names according to your rules
const normalizePersonNames = (person_legal_name, person_performer_name) => {
  const legal = norm(person_legal_name);
  const performer = norm(person_performer_name);

  // Check if both are not null/empty
  const legalPresent = legal !== "";
  const performerPresent = performer !== "";

  if (legalPresent && performerPresent) {
    // Both provided
    if (legal === performer) {
      // Same names - add only as person_name
      return { person_name: legal };
    } else {
      // Different names - add both
      return { person_name: legal, performer_name: performer };
    }
  } else if (performerPresent && !legalPresent) {
    // Only performer name provided - use as person_name
    return { person_name: performer };
  } else if (legalPresent && !performerPresent) {
    // Only legal name provided - use as person_name
    return { person_name: legal };
  } else {
    // Neither provided
    return { person_name: "" };
  }
};

const sanitizePerson = (p = {}) => {
  const normalizedNames = normalizePersonNames(p.person_legal_name, p.person_performer_name);

  return {
    ...normalizedNames,
    status: statusOf(p.status),
    book_number: p.book_number,
    book_id: p.book_id,
    role: p.role
  };
};

// --- Ingest input ---
const items = $input.all();
const payload = items?.[0]?.json?.output ?? {};
const personsRaw = Array.isArray(payload.persons) ? payload.persons : [];

// Clean copies (no IDs)
const persons = personsRaw.map(sanitizePerson);
const verified = persons.filter(p => p.status === "verified");

// For messages
const namesList = (arr) => arr.map(p => `"${p.person_name || "Unknown"}"`).join(", ");

// --- Core logic (messages without IDs) ---
let result;

if (verified.length === 1) {
  const selected = verified[0];
  result = {
    person_verification: "resolved",
    person: selected, // name + status only (no IDs)
    message_for_manager: `${selected.role} ${selected.person_name} is verified in the Manager's workspace. Inform the manager.`
  };
} else if (verified.length > 1) {
  result = {
    person_verification: "duplicate",
    persons: verified, // names + statuses only
    message_for_manager: `Multiple persons ${namesList(verified)} are associated with the manager. Confirm from the manager to select the one he wants to proceed with.`
  };
} else if (persons.length > 1 && verified.length === 0) {
  // NEW branch: multiple persons mentioned, none verified
  result = {
    person_verification: "unverified_multiple",
    persons, // names + statuses only
    message_for_manager: `I found ${namesList(persons)} with the conversation. But none of them is verified in Manager's workspace. Confirm from the manager which individual he is representing.`
  };
} else if (persons.length === 1 && verified.length === 0) {
  const selected = persons?.[0];
  result = {
    person_verification: "not_found",
    message_for_manager: `The ${selected.role}: ${selected.person_name} could not be verified in the Manager's workspace. Inform the manager that deal's and invoices cannot be processed until ${selected.person_name} is registered. Confirm, if there is a misunderstanding in locating the right client and ask for correct information.`
  };
} else {
  // Safe fallback when there are no persons at all
  result = {
    person_verification: "not_found",
    message_for_manager: "I was not able to associate anyone from the conversation with the Manager's. Ask the Manager who he/she is representing."
  };
}

// --- Return ---
return [{ json: result }];

// Safe reads
const book_id = $json?.output?.person_verification?.book_id
const inv = $json?.output?.invoice ?? {};
const invoiceId = (inv.invoice_id ?? "").toString().trim() || null;
const inv_next_step = (inv.next_step ?? "").toString().trim() || null;

const rec = inv.recipient ?? {};
const recStatus = (rec.status ?? "not_provided").trim();
const recName = (rec.name ?? "").trim();
const recNumber = rec.invoice_recipient_number ?? null;

const amount = Number.isFinite(Number(inv.amount)) ? Number(inv.amount) : null;

// Build all valid routes (not exclusive)
const routes = [];

/**
 * Rule 1: by_invoice_id
 * - No other parameter needs to be checked.
 */
if (invoiceId) {
  routes.push({
    route_by: "by_invoice_id",
    invoice_id: invoiceId,
    next_step: inv_next_step,
    book_id 
  });
}

const recipientIsValid = recStatus === "exists" && !!recName;

if (recipientIsValid && amount !== null) {
  routes.push({
    route_by: "by_recipient_with_amount",
    recipient_number: recNumber ?? null,
    recipient_name: recName,
    amount,
    book_id
  });
}

if (recipientIsValid) {
  routes.push({
    route_by: "by_recipient_no_amount",
    recipient_number: recNumber ?? null,
    recipient_name: recName,
    book_id
  });
}

/**
 * Rule 4: by_amount_only
 * - Only when no other scenarios are valid AND amount is provided
 */
if (amount !== null) {
  routes.push({
    route_by: "by_amount_only",
    amount,
    book_id
  });
}

/**
 * Fallback ONLY if no valid routes at all
 */
if (routes.length === 0) {
  routes.push({
    route_by: "no_info_provided",
    recipient_name: recName || null,
    book_id
  });
}

// Output
return { json: { routes } };

// Pull previous payload and current input
const prev = $('Session').first()?.json;
const invoiceInfo = {};
const last_response = "No enough information for invoice search";

// Validate presence of sub_session
if (!prev || !prev.sub_session) {
  throw new Error("Missing sub_session");
}

// Prepare invoice_metadata
let invoice_metadata;
if (Object.keys(invoiceInfo).length > 0) {
  invoice_metadata = {
    invoice_status: "missing",
  };
} else {
  invoice_metadata = {
    invoice_status: "missing"
  };
}

// Update only sub_session (do not mutate original data)
const updatedSubSession = {
  ...prev.sub_session,
  invoice_metadata,
  last_bot_response: last_response
};

// Return original data unchanged + updated sub_session
return [
  {
    json: {
      data: prev.data,
      sub_session: updatedSubSession
    }
  }
];

