function toStr(v) {
  if (v === null || v === undefined) return "";
  return String(v);
}

function isPaid(status) {
  return toStr(status).trim().toLowerCase() === "paid";
}

function stripHtml(s) {
  const str = toStr(s);
  return str.replace(/<[^>]*>/g, " ").replace(/\s+/g, " ").trim();
}

function mdEscape(s) {
  return toStr(s).replace(/\|/g, "\\|").replace(/`/g, "\\`").replace(/\r?\n/g, " ");
}

function tableForInvoices(invoices) {
  const header = `| # | Title | Details | Invoice ID | Amount | Status | Recipient |
|---:|-------|---------|-----------:|-------:|--------|-----------|`;

  const rows = invoices.map((inv, idx) => {
    const t = mdEscape(inv.title ?? "â€”");
    const d = mdEscape(stripHtml(inv.details ?? "â€”"));
    const id = mdEscape(inv.invoice_id ?? "â€”");
    const amt = typeof inv.invoice_amount === "number" ? inv.invoice_amount : (toStr(inv.invoice_amount) || "â€”");
    const st = mdEscape(inv.invoice_status ?? "â€”");
    const rec = mdEscape(inv.invoice_recipient ?? "â€”");
    return `| ${idx + 1} | ${t} | ${d} | ${id} | ${amt} | ${st} | ${rec} |`;
  });

  return [header, ...rows].join("\n");
}

// ---------- Main ----------
const data = $json;
const data_add = $("DIRouting").first().json

const route = toStr(data.route_by).trim();
const invoices = Array.isArray(data.invoices) ? data.invoices : [];
const invoiceType = toStr(data_add.invoice?.request_type || data.request_type || "").toLowerCase();
const recipient = data_add.invoice?.recipient || {};
const routeTo = toStr(data_add.route_to).trim();
const nextStep = toStr(data.invoice_next_step || "").trim();

let crafted_message = "";
let invoice_status = "no_action";

// ---------- Routing Logic ----------
if (route === "by_invoice_id") {
  const inv = invoices[0] || {};
  if (Object.keys(inv).length > 0) {
    // Special case: File request - takes priority over paid/unpaid status
    if (nextStep === "request_as_file") {
      crafted_message =
        "I found below invoice which has been requested by the Manager. Please confirm from the manager if he wants this invoice delivered to him as PDF file. The metadata should include the data and should not be missing.\n\n" +
        tableForInvoices([inv]);
      invoice_status = "invoice_file_requested";
    } else if (isPaid(inv.invoice_status)) {
      crafted_message =
        "I found below invoice which shows that the status is already Paid. There are no updates due to this invoice.\n\n" +
        tableForInvoices([inv]);
      invoice_status = "no_action";
    } else {
      crafted_message =
        `I found the below invoice which has a current status of ${toStr(inv.invoice_status)}. ` +
        "Recommend changes discussed in the thread to the invoice and ask for manager's approval.\n\n" +
        tableForInvoices([inv]);
      invoice_status = "update";
    }
  } else {
