// ------- Constants -------
const DEAL_TYPES = {
  MASTER: "master",
  UNRECOGNIZED: "unrecognized",
};

const ROUTES = {
  DEAL: "deal",
  INVOICE_NO_DEAL: "invoice_no_deal",
  INVOICE_WITH_UNSUPPORTED_DEAL: "invoice_with_unsupported_deal",
  UNSUPPORTED_DEAL: "unsupported_deal",
  NO_MATCH: "no_match",
};

// ------- Helpers -------
const isPresent = (v) =>
  typeof v === "string" ? v.trim().length > 0 : v != null;

// Map assorted spellings to canonical types
const normalizeDealType = (t) => {
  const s = String(t || "").toLowerCase().trim();
  if (["master", "master deal", "masters"].includes(s)) return DEAL_TYPES.MASTER;
  if (["unrecognized", "unrecognised", "unknown"].includes(s)) return DEAL_TYPES.UNRECOGNIZED;
  return s; // e.g., "record", "publishing", etc.
};

// Interpret invoice request status explicitly (adjust list as you standardize)
const toInvoiceStatus = (status) => {
  const s = String(status || "").toLowerCase().trim();
  return ["create", "update", "exists", "present", "true"].includes(s);
};

// Build a single-item n8n return
const respond = (route_to, payload = {}, message, meta = {}) => ([
  {
    json: {
      route_to,
      message,
      ...payload,
    },
  },
]);

// ------- Ingest -------
const input = $("Classifier").first()?.json ?? {};
const person_verification = $("Session").first().json.sub_session?.person_verification ?? {}
const output = input.output ?? {};
const deal = output.deal ?? {};
const invoice = output.invoice ?? null;
const persons = output.persons ?? []; // From classifier output

// ------- Normalize -------
const dealStatus = Boolean(deal.deal_discussion);
const dealType = normalizeDealType(deal.deal_type);
const artist = String(deal.artist_name ?? "").trim();
const masters = Array.isArray(deal.masters) ? deal.masters : []; // Handle new masters array
const invoiceStatus = toInvoiceStatus(invoice?.request_status);

// Extract person details from Session node
const p_name = person_verification.person_name ?? "";
const performer_name = person_verification.performer_name ?? "";

// Enhanced deal object with person details from Session node
const enhancedDeal = {
  ...deal,
  ...(isPresent(p_name) && { person_name: p_name }),
  ...(isPresent(performer_name) && { performer_name: performer_name })
};

const isMaster = dealType === DEAL_TYPES.MASTER;
const isUnrecognized = dealType === DEAL_TYPES.UNRECOGNIZED;

// ------- Routing Logic -------
// Case 1: deal present + master type (no missing requirements check)
if (dealStatus && isMaster) {
  return respond(
    ROUTES.DEAL,
    { deal: enhancedDeal, invoice, person: person_verification },
    "Requirements for deal check satisfied."
  );
}

// Case 2: no deal, but invoice present, and type is explicitly unrecognized
if (!dealStatus && invoiceStatus && isUnrecognized) {
  return respond(
    ROUTES.INVOICE_NO_DEAL,
    { deal: enhancedDeal, invoice, person: person_verification },
    "No deal identified. Proceed with invoice handling without associating a deal."
  );
}

// Case 3a: deal present + invoice present + unsupported (non-master, non-unrecognized) deal type
if (dealStatus && invoiceStatus && !isUnrecognized && !isMaster) {
  return respond(
    ROUTES.INVOICE_WITH_UNSUPPORTED_DEAL,
    { deal: enhancedDeal, invoice, person: person_verification },
    `A "${dealType}" deal appears to be discussed, which is not yet supported. Continue with invoice handling and inform the manager.`
  );
}

// Case 3b: deal present + invoice absent + unsupported deal type
if (dealStatus && !invoiceStatus && !isUnrecognized && !isMaster) {
  return respond(
    ROUTES.UNSUPPORTED_DEAL,
    { deal: enhancedDeal, invoice, person: person_verification },
    `A "${dealType}" deal appears to be discussed, which is not yet supported. Inform the manager and seek clarification.`
  );
}

// Case 4: unrecognized deal type
if (isUnrecognized) {
  return respond(
    ROUTES.UNSUPPORTED_DEAL,
    { deal: enhancedDeal, invoice, persons, person: person_verification },
    `A "${dealType}" deal under discussion. Inform the manager and seek clarification.`
  );
}

// Fallback
return respond(
  ROUTES.NO_MATCH,
  { deal: enhancedDeal, invoice, persons, person: person_verification },
  "The information in the conversation is insufficient to proceed. Ask the manager for clarification with any deal or invoice related operations."
);

// n8n Code node (JavaScript)

