// n8n Code Node - Invoice Analysis Prompt Generator
function generateAnalysisPrompt(invoiceMetadata, invoiceTerms = null, dealStage = null, invoiceRequest = null) {
  const { exists } = invoiceMetadata;
  const recipient = invoiceMetadata?.invoice_recipient|| {};

  // Check if deal is in review stage
  if (dealStage === 'Needs Review') {
    return {
      promptInstructions: `There is no invoice due at this stage of the deal negotiations. Don't mention anything to the Manager on the invoice related to this deal.`,
      process_invoice: false
    };
  }

  // NEW CONDITION: Check if invoice is requested as file
  if (invoiceRequest === 'request_as_file') {
    if (!exists || !invoiceTerms) {
      return {
        promptInstructions: `
No invoice found to send as a file. Please inform the manager that an invoice needs to be created first before it can be sent as a file.
        `.trim(),
        process_invoice: false
      };
    }

    // Build invoice details dynamically - only include fields that have values
    const invoiceDetails = [];

    if (invoiceTerms.invoice_id) {
      invoiceDetails.push(`- Invoice ID: ${invoiceTerms.invoice_id}`);
    }
    if (invoiceTerms.deal_id) {
      invoiceDetails.push(`- Deal ID: ${invoiceTerms.deal_id}`);
    }
    if (invoiceTerms.person_name) {
      invoiceDetails.push(`- Person Name: ${invoiceTerms.person_name}`);
    }
    if (invoiceTerms.invoice_amount) {
      invoiceDetails.push(`- Amount: ${invoiceTerms.invoice_amount}`);
    }
    if (invoiceTerms.due_date) {
      invoiceDetails.push(`- Due Date: ${invoiceTerms.due_date}`);
    }
    if (invoiceTerms.invoice_status) {
      invoiceDetails.push(`- Status: ${invoiceTerms.invoice_status}`);
    }
    if (recipient.name) {
      invoiceDetails.push(`- Recipient: ${recipient.name}`);
    }

    // Only show INVOICE DETAILS section if there are details to show
    const invoiceDetailsSection = invoiceDetails.length > 0 
      ? `INVOICE DETAILS:\n${invoiceDetails.join('\n')}\n\n`
      : '';

    return {
      promptInstructions: `
An invoice file has been requested. Please compile the following invoice details and confirm with the manager:

${invoiceDetailsSection}Please confirm with the manager: "Would you like me to send this invoice to you as a file?"
      `.trim(),
      process_invoice: true,
      requires_file_confirmation: true
    };
  }

  if (exists) {
    // Condition 1: Invoice exists (exists = true)
    if (!invoiceTerms) {
      throw new Error('InvoiceTerms is required when invoice exists');
    }

    if (invoiceTerms.invoice_status === 'Paid') {
      return {
        promptInstructions: `
The invoice already exists and has been paid. Please compile the following information:
- Invoice ID: ${invoiceTerms.invoice_id || 'N/A'}
- Status: ${invoiceTerms.invoice_status}
- Amount: ${invoiceTerms.invoice_amount || 'N/A'}
DESCRIPTION: This invoice with the above details is already paid and requires no further changes or actions.
        `.trim(),
        process_invoice: true
      };
    } else {
      return {
        promptInstructions: `
An existing invoice has been found with the following terms:
${JSON.stringify(invoiceTerms, null, 2)}
Please analyze and compare these invoice terms with the email conversation to identify the final agreed terms. Look for any discrepancies, updates, or modifications discussed in the email thread and provide recommendations for aligning the invoice with the agreed terms.
        `.trim(),
        process_invoice: true
      };
    }
  } else {
    // Condition 2: Invoice does not exist (exists = false)
    let recipientInstructions = '';

    switch (recipient.status) {
      case 'exists':
        recipientInstructions = `- Recipient: ${recipient.name}`;
        break;
      case 'missing':
        recipientInstructions = `- Recipient: ${recipient.name}
  NOTE: Ask the manager whether they want to register this recipient or not.`;
        break;
      case 'not_provided':
        recipientInstructions = `- Recipient: Ask the manager about the invoice recipient details.`;
        break;
      default:
        recipientInstructions = `- Recipient: Status unknown - please clarify with manager.`;
    }

    return {
      promptInstructions: `
No existing invoice found. Please extract the latest agreed details from the email conversation for the following:
1. Deal Title: Create a well-suited deal title based on what's being discussed in the thread.
2. Amount: Extract the latest agreed amount if provided in the email. If not available, set to "Not Provided".
3. Due Date: Identify the due date for the invoice from the conversation. If not mentioned, set to "Not Provided".
4. Status: Set the current status to "Draft".
5. ${recipientInstructions}
FINAL STEP: "Ask the manager for approval to proceed with creating this invoice based on the extracted details.
      `.trim(),
      process_invoice: true
    };
  }
}

// Main execution for n8n
